function cgpGetDataCountInit(){document.querySelectorAll(".cgp-api-hero-banner-data-count").forEach((t=>{cgpGetDataCount(t)}))}function cgpGetDataCount(t){let e=t.getAttribute("data-mode"),a=t.getAttribute("data-theme");if("static"===e){let e=t.getAttribute("data-datasetcount"),a=t.getAttribute("data-contributorcount");cgpGetDataCountShowData(t,e,a)}else{let e=`https://geocore.api.geo.ca/analytics/11?theme=${a}`;"all"==a&&(e="https://geocore.api.geo.ca/analytics/11"),fetch(e,{method:"GET"}).then((function(t){return t.json()})).then((function(e){e.Items.forEach((e=>{let a=e.total,o=e.organization;cgpGetDataCountShowData(t,a,o)}))})).catch((function(t){cgpGetDataCountError(t)}))}}function cgpGetDataCountShowData(t,e,a){t.querySelector(".list-item-datasets .count").innerHTML=`${e}+`,t.querySelector(".list-item-contributors .count").innerHTML=`${a}+`,t.classList.remove("hidden")}function cgpGetDataCountError(t){console.log(t)}cgpGetDataCountInit();
